  return (
    <div className={styles.acount}>
      <div className={styles.banner} style={backgroundImageStyle} />
      <main className={styles.main}>
        <button
                        type="button"
                        onClick={!user ? () => navigate('/AddBook') : disconnect}
                        onKeyUp={!user ? () => navigate('/AddBook') : disconnect}
                        className={styles.Button}
                        aria-label={!user ? 'Se connecter' : 'Se déconnecter'}
                      >
                        {!user ? 'Ajouter un livre' : 'Se déconnecter'}
                        <img
                          src={FeatherIcon}
                          alt="Feather Icon"
                          className={styles.icon}
                        />
                      </button>
        <section className={styles.info}>
          <article>article</article>
          <aside>aside</aside>
        </section>
        <section className={styles.notif}>
          <h4>h4</h4>
          <article>article</article>
        </section>
        <section className={styles.pres}>
          <h4>h4</h4>
          <article>article</article>
        </section>
      </main>
    </div>

  );
}

export default Acount;
